import React from "react";
import "./Dialogs.css"
import Dialog from "./Dialog/Dialog";

function Dialogs(){
    return(
        <div className="dialogs"> 
        <button></button>
        <h3>Владимир</h3>
        <Dialog/>
        </div>
    )
}

export default Dialogs
